/*
 *  Вид действия редюсеров.
 */
export enum ActionKind{
    Clear = 'Clear',
    ChangeAllData = 'ChangeAllData',
    ChangeAllValue = 'ChangeAllValue',
    ChangeInputValue = 'ChangeInputValue'
}
